import React, { useState } from 'react';

import { StyleSheet, Button, View } from 'react-native';
import { StatusBar } from 'expo-status-bar';
import MainButton from './mainButton';

import {
	DefaultTheme,
	Headline,
	Provider as PaperProvider,
	TextInput,
	Text,
} from 'react-native-paper';

const theme = {
	...DefaultTheme,
	roundness: 2,
	colors: {
		...DefaultTheme.colors,
		primary: '#004643',
		accent: '#E16162',
		background: '#004643',
		surface: '#FCFCFF',
		text: '#FFFFFE',
		placeholder: '#ABD1C6',
	},
};

handelOnChange = (enteredText) => {
    console.log(enteredText.nativeEvent.text)
}

export default function SignUp({ navigation }) {
	const [text,setText] = useState('');
	return (
		<PaperProvider theme={theme}>
		<View style={styles.container}>
			<Headline style={styles.logo}>LOGO</Headline>
				<Text>Enter your email address</Text>
				<TextInput
					style={styles.input}
					placeholder='email adress'
					onChangeText={(text) => this.setText({text})}
					value={text}
				></TextInput>
			<MainButton text='Next' title='Sign Up' onPress={() =>{navigation.navigate('SignUpPhone')}}/>
			<StatusBar style='auto' />
		</View>
	</PaperProvider>
	);
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: '#004643',
		alignItems: 'center',
		justifyContent: 'center',
	},
	logo: {
		color: '#E16162',
	},
	input: {
		width: '90%',
		height: 44,
		borderBottomWidth: 1,
		borderBottomColor: '#A6AAB4',
		margin: 10,
	},
	linkedText: {
		color: '#F9BC60',
		textAlign: 'right',
		marginBottom: 50,
		fontWeight: '700',
	}
});
